    var allPlayers = [];

    for (var j = 1; j <= 10; j++) {
        var fullName = playerRank[j.toString()];
        console.log(fullName);
        allPlayers.push(
            axios.get('https://www.balldontlie.io/api/v1/players?search=' + fullName).then(result => new Promise(resolve => resolve(result.data.data[0])))
